document.addEventListener("DOMContentLoaded",(function(){const e=document.querySelectorAll(".movie"),t=document.querySelector(".back-btn");e.forEach(e=>{e.addEventListener("click",e=>{let t=e.target.attributes[1].value;var n="movie-detail?id="+encodeURIComponent(t);window.location.href=n})}),null!==t&&t.addEventListener("click",()=>{window.history.back()})}));